<div class="entities" style="line-height: 2.5; direction: ltr">The presence and function of dopamine type 2 receptors in boar sperm : a possible role for dopamine in viability , capacitation , and modulation of sperm motility . Several studies have shown that dopamine and other catecholamines are present in oviduct luminal fluid . We recently reported that dopamine type 2 receptors (

 and that their activation with dopamine ( 100 nM ) has a positive effect on cell viability that can be correlated with AKT /

 phosphorylation .

 ( 100 nM ) and dopamine ( 100 nM and 10 muM ) increased tyrosine phosphorylation during the capacitation period . Immunofluorescence analysis indicated that

 , official symbol

<div class="entities" style="line-height: 2.5; direction: ltr">DB00171 - sensitive potassium channels ( K ( DB00171 ) ) in retina : a key role for delayed ischemic tolerance . The objectives of the present study were to determine the localization of K ( DB00171 ) channels in normal retina and to evaluate their potential roles in ischemic preconditioning ( IPC ) in a rat model of ischemia induced by increased intraocular pressure ( IOP ) . Brown Norway rats were subjected to sublethal 3 - , lethal 20 - and 40 - min ischemia and the functional recovery was evaluated using electroretinography . The time interval between ischemic insults ranged from 1 to 72 h . The effects of K ( DB00171 ) channel blockade on IPC protection were studied by treatment with 0.01 % glipizide . IPC was mimicked by injection of K ( DB00171 ) channel openers of 0.01 % ( - ) cromakalim or 0.01 % P1060 72 h before 20 - min ischemia . Co-expression of K ( DB00171 ) channel subunits Kir 6.2 / 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    Q09428

</mark>
 was observed in the retinal pigment epithelium , inner segments of photoreceptors , outer plexiform and ganglion cell layers and at the border of the inner nuclear layer . In contrast to a 20 - or 40 - min ischemia , a 3 - min ischemia induced no alteration of the electroretinogram ( ERG ) and constituted the preconditioning stimulus . An ischemic challenge of 40 min in preconditioned rats induced impairment of retinal function . However , animals preconditioned 24 , 48 and 72 h before 20 - min ischemia had a significant improvement of the ERG . ( - ) Cromakalim and P1060 mimicked the effect of IPC . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

<h2 style="margin: 0">13</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Microtubule-depolymerizing agents used in antibody-drug conjugates induce antitumor immunity by stimulation of dendritic cells . Antibody-drug conjugates ( ADC ) are emerging as powerful treatment strategies with outstanding target-specificity and high therapeutic activity in patients with cancer . 
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB08870

</mark>
 represents a first-in-class ADC directed against 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P28908
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ( + ) malignancies . We hypothesized that its sustained clinical responses could be related to the stimulation of an anticancer immune response . In this study , we demonstrate that the dolastatin family of microtubule inhibitors , from which the cytotoxic component of brentuximab vedotin is derived , comprises potent inducers of phenotypic and functional dendritic cell ( DC ) maturation . In addition to the direct cytotoxic effect on tumor cells , dolastatins efficiently promoted antigen uptake and migration of tumor-resident DCs to the tumor-draining lymph nodes . Exposure of murine and human DCs to dolastatins significantly increased their capacity to prime T cells . Underlining the requirement of an intact host immune system for the full therapeutic benefit of dolastatins , the antitumor effect was far less pronounced in immunocompromised mice . We observed substantial therapeutic synergies when combining dolastatins with tumor antigen-specific vaccination or blockade of the 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P18621
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 - Q9NZQ7 and 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P16410
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 coinhibitory pathways . Ultimately , treatment with ADCs using dolastatins induces DC homing and activates cellular antitumor immune responses in patients . Our data reveal a novel mechanism of action for dolastatins and provide a strong rationale for clinical treatment regimens combining dolastatin-based therapies , such as brentuximab vedotin , with immune-based therapies .</div>

<h2 style="margin: 0">24</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Prasugrel : a new antiplatelet drug for the prevention and treatment of cardiovascular disease . Prasugrel , trade name 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB06209
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 , is an investigational new antiplatelet drug currently under review for clinical use by the Food and Drug Administration . It is a thienopyridine analog with a structure similar to that of clopidogrel and ticlopidine . Thienopyridine derivatives inhibit platelet aggregation induced by adenosine diphosphate by irreversibly inhibiting the binding of adenosine diphosphate to the purinergic 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    Q9H244
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 receptor on the platelet surface . Prasugrel has been shown to be a potent antiplatelet agent with a faster , more consistent , and greater inhibition of platelet aggregation compared with clopidogrel . It is debatable , however , how effectively these pharmacologic benefits will translate to clinical benefits . The results of the large TRITON-TIMI 38 trial , which compared prasugrel and clopidogrel in patients with acute coronary syndrome who were scheduled to receive coronary stents , demonstrated a significant reduction in ischemic events , including stent thrombosis , with prasugrel , but with an increased risk of major bleeding . The exact role of prasugrel in the management of ischemic heart disease is still being defined , but the risk : benefit ratio will likely play a major role in directing the best place for therapy with this new agent .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Comparison of variations detection between whole-genome amplification methods used in single-cell resequencing . BACKGROUND : Single-cell resequencing ( SCRS ) provides many biomedical advances in variations detection at the single-cell level , but it currently relies on whole genome amplification ( WGA ) . Three methods are commonly used for WGA : multiple displacement amplification ( MDA ) , degenerate-oligonucleotide-primed PCR ( DOP-PCR ) and multiple annealing and looping-based amplification cycles ( MALBAC ) . However , a comprehensive comparison of variations detection performance between these WGA methods has not yet been performed . RESULTS : We systematically compared the advantages and disadvantages of different WGA methods , focusing particularly on variations detection . Low-coverage whole-genome sequencing revealed that DOP-PCR had the highest duplication ratio , but an even read distribution and the best reproducibility and accuracy for detection of copy-number variations ( CNVs ) . However , MDA had significantly higher genome recovery sensitivity ( ~ 84 % ) than DOP-PCR ( ~ 6 % ) and MALBAC ( ~ 52 % ) at high sequencing depth . MALBAC and MDA had comparable single-nucleotide variations detection efficiency , false-positive ratio , and allele drop-out ratio . We further demonstrated that SCRS data amplified by either MDA or MALBAC from a gastric cancer cell line could accurately detect gastric cancer CNVs with comparable sensitivity and specificity , including amplifications of 12p11 . 22 ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P01116
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) and 9p24 . 1 ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    O60674
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 , Q9NZQ7 , and Q9BQ51 ) . CONCLUSIONS : Our findings provide a comprehensive comparison of variations detection performance using SCRS amplified by different WGA methods . It will guide researchers to determine which WGA method is best suited to individual experimental needs at single-cell level .</div>
